VALUES
	(46,'Machi Block','kavadbaclothingco@hotmail.com','http://www.elevatedclothingco.com','','','','','Hey guys, great site. I\'m looking for mesh tank tops like a basketball Jersey, but we\'re using them for wakeboarding. I\'m sure you know what I\'m talking about. \r\n\r\nI was wondering if you do them, and if so, if I could get a quote for them. I\'m looking for about 40 of one design and 40 of another. \r\n\r\nThanks. Please get back to me at your earliest convenience.','flabbily',0,'0000-00-00 00:00:00',1),
	(9,'Ginger Goodspeed','ginger@evespeedsports.com','www.evespeedsports.com','','','','','Hello!\r\n\r\nWe are adding a line of apparel and accessories to our lacrosse gear line.  Please contact me about supplying our apparel and accessories that will be sublimated.\r\n\r\nI look forward to hearing from you.\r\n\r\nWishing you a GREAT Day!\r\n\r\nGinger\r\n\r\nGinger Goodspeed\r\nEVESPEEDSPORTS.com\r\n+1-503-707-6530','diplopia',0,'0000-00-00 00:00:00',0),
	(149,'Jamie Pearson','pearson153@rocketmail.com','','','','','','Can you email me the size chart for the 1/4 zip fishing shirts and T-shirts--I clicked the button but it didn\'t open it.\r\nThanks!','inflatus',0,'2012-06-05 11:12:35',0),
	(147,'Bradley Piper','bpiper@unionky.edu','','','','','','I am trying to see if your company has any sponsorship open for the 2012-2013 season.  If not would you be interested in getting into the bowling college seen?  I would love to help you do that.  Also, what would it cost for 40 custom jerseys (16 of one design and 24 of another design)?','murga',1,'2012-06-02 02:52:34',1),
	(41,'Charles Steiner','inferno41@yahoo.com','','','','','','i am having trouble logging into your website to down load the order form','primost',0,'0000-00-00 00:00:00',1),
	(44,'Skylar','Sjwolen24@gmail.com','','','','','','I need a remake of a jersey if thats possible? and i need to do some changes','abductor',0,'0000-00-00 00:00:00',1),
	(45,'Heather Collier','heather824323@gmail.com','','','','','','I would like to get an order set up. I have pictures together of what we are looking for and the type of shirts we want. I run a co-ed softball team of 20 players. Please call me asap so that we can get this started. Thanks so much for your time! My number is 302-222-2600.','bonhomie',1,'0000-00-00 00:00:00',1),
	(47,'aaron totten','neo_tottenen@hotmail.com','','','','','','am inquiring about jerseys before our upcoming tournament in may, i only need 3 done but need quote and to discuss design','choroid',0,'0000-00-00 00:00:00',1),
	(48,'Michael','mike.d.ortega@gmail.com','','','','','','I was trying to make custom paintball gear however your links on your templates just link back to the same page and do not give you an actual template. Also, I like the new site. Its looking good.','shelly',0,'0000-00-00 00:00:00',1),
	(49,'Jerry Adamowicz','jerrya@dsl-only.net','','','','','','Hello,\r\nLast year we ordered our Team Jerysey\'s from you, and we\'d like to order a few more. Team Name = Shooter\'s Inc. We paid you $600 on March 17th 2011. I hope that helps you find the original Order. Please let me know this years price for the same design/jersey, and we will get you the order ASAP. Thank you, Jerry','melenic',1,'0000-00-00 00:00:00',1),
	(50,'Ethan Mattair','madpaintballer@yahoo.com','','','','','','i have a design that i got and was wondering if it was possible to turn it into a paintball jersey. would you be willing to make it?','unhired',0,'0000-00-00 00:00:00',1),
	(51,'Shaikh Jamal Uddin','jamal@securecoat.net','www.securecoat.net','','','','','Hi,\r\n\r\nI send you an email regarding Graphics Design work at sales@i2icustom.com. \r\n\r\nPlease check it out.\r\n\r\nThank you.\r\n\r\nJamal','seedlip',0,'0000-00-00 00:00:00',1),
	(52,'Derek Johnson','info@evoembroid.com','','','','','','Hi,\r\nWe are an embroidery company and we have a lot of customers looking for custom sublimated apparel, so have created there own spec sheets and we want to know if you guys can use those?','iriartea',0,'0000-00-00 00:00:00',1),
	(53,'Rebecca','barrecca@gmail.com','','','','','','Hello, \r\nI have a bit of an odd request that I am hoping you can help me with. I am located in Edmonton, Alberta and my best friend and I have always talked about getting Jerseys, but have never done it. She is now going to South Africa at the end of this year (September 2012) for 2 years and as her going away present I want to custom make two jerseys (One for myself and one for her). I have had a hard time finding a company that will make &quot;one of\'s&quot; or any quantity less than 10. I also have some pretty specific requirements but do not have access to a web design program or logo maker type program as I would usually ask my friend to do that for me. I am hoping you will be able to help!!! \r\nI am also not sure what the time difference there is and am wondering what your hours of operation are so that I could perhaps call in and talk to someone in your office about everything. Thank you for your time, I am looking forward to hearing from you.\r\n \r\nThanks again, \r\nRebecca','phases',1,'0000-00-00 00:00:00',1),
	(54,'Dale Sutton','dale77@shaw.ca','','','','','','Looking to see what you have for Box Lacrosse Jerseys. I cannot open your product page for Box Lacrosse.','deink',0,'0000-00-00 00:00:00',1),
	(55,'Brady','brenda.dayries@yahoo.com','i2icustom','','','','','how can i make my own jersey on your website','unbossed',0,'0000-00-00 00:00:00',1),
	(56,'Chuck Paladino','syphontek@gmail.com','','','','','','I\'m having a shirt made up (Steel City Swat) and I was told that it would be ready Friday. I wanted to stop at your store to pick it up but I don\'t know your hours of operation.','amentum',1,'0000-00-00 00:00:00',1),
	(57,'Chuck Paladino','syphontek@gmail.com','','','','','','I\'m having a shirt made up (Steel City Swat) and I was told that it would be ready Friday. I wanted to stop at your store to pick it up but I don\'t know your hours of operation.','amentum',1,'0000-00-00 00:00:00',1),
	(58,'Chuck Paladino','syphontek@gmail.com','','','','','','I\'m having a shirt made up (Steel City Swat) and I was told that it would be ready Friday. I wanted to stop at your store to pick it up but I don\'t know your hours of operation.','amentum',1,'0000-00-00 00:00:00',1),
	(59,'Brent Nutt','brentnutt@comcast.net','','','','','','Can I order just a solid Black paintball jersey from you, with nothing on it at all.','bogart',0,'0000-00-00 00:00:00',1),
	(60,'Joseph Hallgren','revolution13paintball@aol.com','www.TeamRevolution13.com','','','','','hello,\r\n\r\nI was wondering the cost of getting a proof done to see what the jersey would look like before ordering. I would like to do this to show my team what the jersey would look like before selecting which one we like the best. We would be using a House Design, but with our logo, names, and numbers. \r\n\r\nThanks!','bumper',0,'0000-00-00 00:00:00',1),
	(61,'Richard Tatom III','tates6711@yahoo.com','','','','','','Hi, I\'m interested in getting a 2xL AKA jersey made its the red/black one on page 53 of the gallery. I would like it to be created with set-in style and the name 711clerk across the upper back with the number 11 below it. I would like it to be done with this same pattern design here: http://img.photobucket.com/albums/v646/toceltic/DSC03452.jpg\r\n\r\nYou can reach me by my email: tates6711@yahoo.com and let me know price/instructions on placing the order for this.\r\n\r\nThanks,\r\nRich','buyable',0,'0000-00-00 00:00:00',1),
