	(311,'Jesse Crozier','j.crozier@hotmail.com','','403-801-8677','A11 Parklane drive','Ab','T1P1C2','To whom it may concern,\r\n\r\n	H4H is a well-respected team in the Calgary area. We are a committed group of players, whose purpose is far more than just winning. Softball to us is more of a lifestyle and an outlet. The goal of our team is to grow the sport, protect the purity and enjoyment of the game, the development of skills and to bring new players into the game.\r\n\r\n\r\n Using the ideals and fundamentals laid down by our team, H4H intends to build a name for itself in the softball community not only through winning events, but also through unparalleled sportsmanship and commitment to the game. We intend to build our great sport and continue to improve our own skills.\r\n\r\n\r\n	We participate in a variety of tournaments throughout the season, and are as seen as a competitor. With our team being filled with high level players, our finishes are consistently among the top 4. We continue to challenge and push ourselves and each other in our practices and tournaments by playing against teams with more experience and other higher division players in order to hone our skills to become better players. \r\n\r\n\r\n	The individuals on our team come from a wide area of diversified backgrounds, ranging from students, hospitality workers, trades workers and small business owners. Character and integrity run deep in all members of our team, with professionalism illustrated in each member, both on and even more importantly, off the field. We as a team are committed to upholding and portraying a positive image for our team, our sponsors and ourselves individually.\r\n\r\n\r\n	Our purpose for seeking sponsorship is not to just see what you can do for us, but what we can do, with your support, collaboratively to promote and grow the sport. H4H is open to all types of sponsorships as well as any help we can receive, or anything we can do to promote your company, and promote the game. you know that you have a good product and we know you have a good product. We feel that we can help expand your brand awareness across western Canada. We play in many tournaments throughout Alberta and BC. We are looking to expand our tournament list each year and hope that we can sport i2icustom to them. \r\n\r\n\r\nThank you for both your time and consideration.\r\n\r\n\r\nSincerely,\r\n\r\n	\r\n\r\nH4H\r\n\r\nJesse Crozier, Team Manager/Captain','subitem',1,'2013-01-22 05:08:08',0),
