INSERT INTO `custom_products` (`id`, `title`, `content`)
VALUES
	(1,'DIGITAL DYE-SUBLIMATION','That is the proper name of our process, also simply known as Sublimation\n<table style=\"margin-top:-800px\">\n  <tr>\n    <td width=\"200px\">Digital</td>\n    <td colspan=\"2\">- Since graphics and the printing process is driven by computers</td>\n  </tr>\n  <tr>\n    <td>Dye</td>\n    <td colspan=\"2\">- The color that is printed and then transferred into fabric</td>\n  </tr>\n  <tr>\n    <td>Sublimation</td>\n    <td colspan=\"2\">- Means to change from a solid to gas and back to a solid without becoming a\nliquid Sublimation is a very green printing process, we use water-based dyes that have absolutely no environmental impact. The harshest chemical used in our process is Windex.</td>\n  </tr>\n  <tr>\n    <td>Advantages Over</td>\n  </tr>\n  <tr>\n    <td>Silk Screening :</td>\n    <td>Incredible graphics</td>\n    <td>Extreme Personalization</td>\n  </tr>\n  <tr>\n    <td></td>\n    <td>Cost - comparing color work</td>\n    <td>Durability</td>\n  </tr>\n  <tr>\n    <td></td>\n    <td>Unlimited colors and color matching</td>\n    <td>Zero hand feel</td>\n  </tr>\n  <tr>\n    <td colspan=\"3\" align=\"center\">Aside from the fact that Sublimation and Silk Screening are both used to decorate garments, they are two very different methods and so are their results</td>\n  </tr>\n</table>\n<div>\n	<img src=\"assets/img/web/link-1-1.png\">\n</div>'),
	(2,'ARTWORK','<div>\n<div style=\"width:50%; display:inline-block; vertical-align:top; line-height:30px; font-size:20px\">\nArtwork is the most important part of sublimation. This is where creativity and experience counts the most.\n\n\nYour choices:\n1	- You can choose from hundreds of designs\nthat we will modify for you.\n2	- We will design exactly what you want,\nfrom concept to finish.\n3	- You can do the design yourself - we will be\navailable to help at every step of the way.\n\n\nEverything is computer driven - so you can apply any special effects known to man. We will personalize every single garment - this typically is a name and number, but could be individual colors or logos as well. Artwork is resized for each size, so everything is proportional to your body size.\n</div><div style=\"display:inline-block\">\n<img src=\"assets/img/web/link-1-2.png\">\n</div>\n</div>'),
	(3,'PRINTING','<div>\n<div style=\"width:50%; display:inline-block; vertical-align:top; line-height:30px; font-size:20px\">\nWe want to make sure our garments are the best quality they can be. To do this we use the world\'s best and newest printers. To make sure these machines perform at the quality we insist upon they are tested every hour. This test ensures the printers are running smoothly and the colours are perfect. The image is printed in reverse.\n\nInks and paper that we use are specially designed for sublimation.\n</div><div style=\"display:inline-block\">\n<img width=\"400px\" src=\"assets/img/web/link-1-3.png\">\n</div>\n</div>'),
	(4,'TRANSFER','<div>\n<div style=\"width:50%; display:inline-block; vertical-align:top; line-height:30px; font-size:20px\">To transfer the image from paper to fabric, we use a large heat press. The ink (dye) turns into gas and becomes part of the fabric on a molecular level.\n\nOnce the two have bonded its nearly impossible to separate them. We have done tests; including soaking one sample in pure bleach for 48 hours. Afterwards we could not tell the difference between our sample and the original.\nExposing the fabric to high heat will start the sublimation process again. This is highly unlikely unless you get the garment exposed to 400 F.\n</div><div style=\"display:inline-block; vertical-align:top\"><img width=\"400px\" src=\"assets/img/web/link-1-4.png\">\n</div>\n</div>'),
	(5,'CUTTING & ASSEMBLY','<div><div style=\"width:50%; display:inline-block; vertical-align:top; line-height:30px; font-size:20px\">Excess fabric gets cut-off, so we are left with the garment panels only.\n\nOther items - such as side mesh, cuffs and collar get added and the pieces are ready for sewing.\nFabrics that we use regularly come from local manufacturers and are made to our specifications. So in a way our product is custom in that respect as well.\n</div><div style=\"display:inline-block\"><img width=\"400px\" src=\"assets/img/web/link-1-5.png\">\n</div>\n</div>'),
	(6,'SEWING','<div><div style=\"width:50%; display:inline-block; vertical-align:top; line-height:30px; font-size:20px\">The garment is sewn together. Typically this is a multi step process that involves many sewing machines.\n\nOur little sweat shop has over 30 machines. To cut down on costs we are always looking for child labourers, unfortunately no luck so far.\n</div><div style=\"display:inline-block\"><img width=\"400px\" src=\"assets/img/web/link-1-6.png\">\n</div>\n</div>\n'),
	(7,'SHIPPING','<div><div style=\"width:50%; display:inline-block; vertical-align:top; line-height:30px; font-size:20px\">Product is FINISHED !!!\n\nThe order is checked and double checked, packaged and shipped.\nThis is the easiest part of the process that seems to create the most problems. It seems, everybody wants everything yesterday.</div><div style=\"display:inline-block\"><img width=\"400px\" src=\"assets/img/web/link-1-7.png\">\n</div>\n</div>'),
	(8,'ENJOY','<div><div style=\"width:50%; display:inline-block; vertical-align:top; line-height:30px; font-size:20px\">You have received your order and are going to put it to good use.\n\nWhen you look good - You feel good and it seems that team\'s confidence goes up as well. Many of the teams that we have worked with, tell us their game has dramatically improved and many have gone on to win tournaments.\nWe are the best at what we do. We expect YOU to do the same.</div><div style=\"display:inline-block\"><img width=\"400px\" src=\"assets/img/web/link-1-8.png\">\n</div>\n</div>');
