	(30,'Hiromi','Hiromi','maria.flink@aktivkapital.se','IXQnfIyx','I moved away from my main group of friends a nuembr of years ago because of work, and our lives have all taken many twists and turns since such that we have all found maintaining our friendships at their previous level difficult. I still miss these friends and though I have made others, these friendships do not  seem to have  the same depth and it is not just because they are newer. As I get older, I find that people seem to have less time and energy for friendship among the competing demands of work and family, and I find this sad although I am guilty of it also. When I moved here, I  also met some people who I felt offered potential as friends, but they seemed to already have as many friends as they could cope with and were not really interested in including any more. I would do anything to help my friends, but I could not say the same of all of them. However, one of the pleasures of getting older is that one gets more philosophical about peoples\' capabilities and alters expectations accordingly. My husband remains my best friend and our relationship compensates much for any perceived shortcomings of others. I have also had the enjoyment of forging much better relationships with siblings and some relatives as we have all &quot;grown up&quot; a bit.','2012-08-21 03:41:17',0),
