h DHL and do have good rates for the shipping and as soon as I got your catalog I will calculate the shipping cost and will inform you.\r\n4.      Quantity: Note that we are working from 1 to any number.\r\nIf you need we can submit you our samples so that you can evaluate our quality and can discuss further business with us. If you do have any further question or information required from my side do let me know. I assure you that I will provide you good quality products\r\nBest regards,\r\nS.I.T.E Factory: \r\n21/180 chah jattan  sailkot-pakistan \r\nOffice: +92-52-566971\r\nFax   : +92-52-566972\r\nCell   : +92-333-3319991\r\nFlexfits@gmail.com\r\nwww.flexfitsports.com','2013-02-05 03:36:33',0),
