INSERT INTO `fabric_detail` (`id`, `title`, `content`, `compos`, `weight`, `feel`, `durab`, `impact`, `thick`, `breat`)
VALUES
	(1,'ADRENALINE','This is our most popular high performance fabric. \nWe specifically designed it for sport jerseys. It is durable \nenough to slide and roll in, yet it is soft and very comfortable \nto the skin. Extremely versatile and ideal for highly active \nsports with low to medium impact.',' 100% Polyester','160gm/SqM or 4.7 oz/SYD','Very Comfortable','Excellent','Light to Medium','Medium','Excellent'),
	(2,'DAZZLE','This fabric is extremely sleek and shiny. The shiny finish really\nbrings out all the colors and gives the garment a very flashy look. \nThis is why we also use it for our banners.\n \nWe recommend this fabric to be used for garments that are\nintended for indoors and soft surfaces such as grass\n(Basketball, Soccer). Due to its fine surface we find that\nabrasive contact does damage the top layer of the fabric.',' 100% Polyester','195gm/SqM or 5.7 oz/SYD','Comfortable','Very Good','Light','Heavy','Good'),
	(3,'DOUBLE KNIT - Heavy','Double knit fabric is formed from two different synthetic \nyarns giving the fabric superior qualities. Very durable \nand super strong, yet comfortable and stretchable. \nIdeal for garments that provide extra protection, such as \nbaseball pants, jackets and hoodies. There is also \n\"Double Knit - Light\" that is pretty much the same \nexcept it\'s thickness.',' 100% Polyester','400gm/SqM or 8.5 oz/SYD','Comfortable','Very Good','Heavy','Very Heavy','Very Good'),
	(4,'DOUBLE KNIT - Light','Double knit fabric is formed from two different synthetic \nyarns giving the fabric superior qualities. Very durable and \nsuper strong, yet comfortable and stretchable. Ideal \nfor garments that provide extra protection, such as baseball \npants, jackets and hoodies. There is also \n\"Double Knit - Heavy\" that is pretty much the \nsame except it\'s thickness.',' 100% Polyester','205gm/SqM or 6.1 oz/SYD','Comfortable','Excellent','Heavy','Very Heavy','Very Good'),
	(5,'FLEECE','High-tech fabric that is light, worm and soft to the touch.\nDesigned to mimic wool and in many ways it even surpasses it.\nFor it\'s thickness, this is a very light fabric. Holds very \nlittle moisture and retains much of its insulating power even \nwhen wet. It is highly breathable. Great for garments \nthat require heat and comfort. We primarily use it for Pyjama \nbottoms and as an insulating layer for winter garments.',' 100% Polyester','200gm/SqM or 6.0 oz/SYD','Excelent Comfortable','Very Good','Light to Medium','Medium','Very Good'),
	(6,'KILL KENNY','This fabric has been designed by us specifically for extreme \nsports. You can think of it as your body armour. It is a fairly \nheavy fabric with good stretch ability. Ideal for outdoor \npaintball (woodsball) or heavy contact sports that require \nprotective gear. Due to its thickness it does restrict \nmovement and it does get hot in direct sun. \nVery resistant to Velcro.',' 100% Polyester','345gm/SqM or 7.25 oz/SYD','Comfortable','Excelent','Excellent','Heavy','Very Good'),
	(7,'MESH - Heavy','This fabric has large honeycomb holes which allow air to \npass through freely, this assists and improves wicking and \nspeeds-up evaporation. Any garment that is to be used in \nextreme situations should have side mesh build in. \nThe side mesh basically turns your jersey into a small \nwind tunnel making sure the air does not get stagnate \nwithin your jersey, but flows right through. Proper \nair movement is mandatory in garments to be used \nin high perspiration activities.',' 100% Polyester','190 gm/SqM or 5.6 oz/SYD','Comfortable','Excelent','Excellent','Heavy','Excelent'),
	(8,'NEMO','This is a very breathable, flexible, soft and durable fabric. \nIt stretches extremely well in any direction. Your outfit \nwill not interfere with your flexibility and range of motion. \nIdeal for body fitting garments. Incorporated compression \ntechnology helps prevent muscle fatigue and provides \nadditional muscle support allowing you to perform \nat peak level.','84% Wicking & anti UV Polyester + 16% Spandex','230 gm/SqM or 6.75 oz/SYD','Very Comfortable','Very Good','Very Good','Medium','Excelent'),
	(9,'NEOPRENE','This fabric has been designed for water activities such \nas a wet suit for diving. It traps water within it\'s body \n(small air bubbles) and uses your body temperature to \nheat the water pockets. The thicker the material the \nmore protection you get. We use this material primarily \nfor swimming vests and gloves. It is also ideal for \nprotecting items from harsh impact, so we also use it to \nmake barrel covers (paintball), knee pads and protective \nproducts for electronics such as an ipad.','Neoprene','2 mm Thickness','Comfortable','Very Good','Excellent','Very Thick','Does not Appy'),
	(10,'PADDING','Heavy fabric that is designed to absorb shock from impact. \nHas a fluffy feel to it and acts as an absorber. \nThe feel is comfortable to the touch.',' 100% Polyester','200 gm/SqM or 6.0 oz/SYD','Extremely Comfortable','Very Good','Light to Medium','Medium','Very Good'),
	(11,'RIB - Heavy','This is an extremely strong stretchable fabric that we \nprimarily use for collars and cuffs on extreme sport garments. \nThe heavy rib is specifically designed for taking moisture \naway from your body where it counts the most. The extra \nstretch and strength ensures that your cuffs don\'t wear \nout and/or get stretched out. Unfortunately we can \nnot print on this fabric, so when your cuffs and collar \nhave to be printed we use \"Rib - Light\"',' 100% Polyester','190 gm/SqM or 5.6 oz/SYD','Comfortable','Extreme','Extreme','Heavy','Excellent'),
	(12,'RIB - Light','This is a strong and very stretchable fabric that we primarily \nuse for collars and cuffs on daily wear and light to medium \nimpact sport garments. The rib is specifically designed for \ntaking moisture away from your body where it counts\nthe most. The extra strength and stretch ensures that \nyour cuffs don\'t wear out and/or get stretched out. Not like \n\"Rib - Heavy\", we are able to print on this fabric and we do \nuse it as substitution on extreme garments when \ncuffs and collars are to be printed.',' 100% Polyester','180 gm/SqM or 4.9 oz/SYD','Very Comfortable','Very Good','Very Good','Medium','Excellent'),
	(13,'STIFFY','This is an extremely durable fabric designed for outside \nbanners. We use it for our banners and barrel covers \n(paintball) as well. \nNot suitable for clothing.',' 100% Polyester','300 gm/SqM or 8.25 oz/SYD','Rough','Extreme','Extreme','Heavy','Does not Appy'),
	(14,'SUPER KNIT','This fabric has been scientifically designed specifically \nfor hockey jerseys. This is a quick dry fabric that is very \nbreathable, easy care, wrinkle resistant and static free. \nKind to sensitive skin, durable even after prolonged use. \nCan\'t praise this fabric enough.',' 100% Polyester',' 245 gm/SqM or 7.25 oz/SYD','Comfortable','Extreme','Extreme','Heavy','Very Good'),
	(15,'SUPREMACY','This is a very light material and feels like wearing nothing \nat all. Perfect for daily wear, hot weather conditions and \nendurance sports. Actively redirects heat and sweat \naway from your body. Provides comfort in strenuous no \nimpact activities such as running. It is also ideal as your \nfirst layer in winter activities. Dries extremely fast.',' 100% Polyester','145 gm/SqM or 4.3 oz/SYD','Very Comfortable','Good','None','Light','Excellent');
INSERT INTO `faq` (`id`, `title`, `content`)
VALUES
	(1,'Colors','Designing a garment requires more attention and some measuring. \nHere are some pointers to help you out. Make sure you use RGB \ncolors. Using CMYK or any other palette will create strange results.\n \nThe number one mistake people make, is that they make everything \ntoo big. It looks proportional on the artwork, but you have to take \ninto consideration the fact that this will become an object that \nwraps around your body and some things will be hidden. \nFor example a logo on your arm - most people make it 8\" wide, \nif you measure your arm you will see that only about 4\" are visible, \nthe rest you will not be able to see. Measure the area on your body \nand apply that size to your art.\n \nDue to sewing you loose 1/4\" all around, at the bottom you \nloose 3/4\". So if there is something important, keep it \nat least 1\" from any edge.'),
	(2,'Download Template','Considering that most of our garments have multiple options \nthat effect the pattern, you will have to start the Order \nprocess. This allows you to select the garment and the \noptions that are specific to you and the system will provide \nyou with the correct pattern.\n\nMake sure you click on the \"Add to Cart\" button \non the \"Order - Individual Items\" page and the check \nmark turns green. You will be able to select multiple items.'),
	(3,'Fabrics','We do our best to describe each fabric that we carry. If still\nnot sure, you can always call us and we will advise you as \nbest as we can.\n\nFor situation where you just have to see and feel the fabric, \nwe have created fabric swatches. This package includes \nevery single fabric that we carry and it is also printed with \nbasic colors. That way you not only get to see and feel the \nfabric, you also get to see our colors. You may also specify which \ncolors we should be using, if color matching is important.\n\nUnfortunately there is a $15 fee for this service, \nwhich does include shipping.\n\nEach fabric page has a button \"Mail Samples\" which will direct \nyou to our order form and payment processing page.\nOr you can just click it - below.'),
	(4,'Ideas','You have decided to get a custom garment - great. If you know what \nyour design is going to be - you are the lucky one. If you don\'t\nmake yourself comfortable and get ready to Google.\n\nTypically your logo is the focus point of everything. It dictates what \ncolors we will be using and the background objects. They should all \nbe in harmony (some exceptions apply). If you don\'t have a logo, \nget that done first. If you have a spectacular design, we can always \ndesign a logo to match it.\n\nFirst take a look at our \"House Designs\". We are able to adjust any \ndesign in any way to suite your needs. Change colors, add/or \nremove things and even combine multiple designs to make one.\n\nIf our designs don\'t work for you, I highly recommend these two sites. \nYou can purchase art at either one or you can email us a picture \nto be used as an inspiration for your design.\n\nhttp://www.vectorstock.com - very inexpensive, vectores only\nhttp://www.shutterstock.com - pricey, but the selection is worth it\n\nFonts are a very important part of any art. \nPlease visit: http://www.dafont.com. \nThe site allows you to type in your wording and will show you the \nresult in the selected font. Huge selection (free), no need to go \nanywhere else.\n\nThe better idea you give us, the faster and more accurate we will be.'),
	(5,'Multiple Art','There are two possibilities.\n \n#1\nYou have a home and away design. The design is identical, except for the colors used. In this case, we will not charge you for additional art. You proceed as a new order and when you get to the \"Artwork\" section, just select the \"I have art\" option under \"Artwork Ready\" box. You will have to pay the $15 set-up fee, but it is only fair since we do have additional work with your art.\n \n#2\nYour art is completely different from your other order. In this case we have to treat this as a completely new order, the only savings you have is by combining shipping and sending it as one order. Please indicate in notes when there are multiple orders.'),
	(6,'Ordering','tep #1 - Select a Garment(s) - \"Products\"\nKeep in mind you have to place separate orders if you are using \ndifferent art (see FAQ\'s - Multiple Art). If you are using same art,\nyou can place an order for multiple garments.\n \nStep #2 - Artwork\n \nOption A\nSelect one of our designs (House Designs). We will adjust the colors and the design to you satisfaction. We will also create a logo if you need one and add any sponsor logos if any. The cost for this service is $40 which includes our $15 set-up fee.\n \nOption B\nfor $80 we will design exactly what you want. What does it include? - everything, even the $15 set-up fee.\n \nOption C\nDownload our template - free (see FAQ\'s - Download Template) Create your own design or use a third party to do it for you. All instructions are within the file. Feel free to contact us if you have any questions. $15 set-up fee will apply.\n \nStep #3 - Order\n \nConsidering all the options we are offering, we did our best to keep \nthe ordering system as simple as possible. Our system can handle\nmultiple artworks, ordering multiple garments for each art while\nbeing able to personalize each garment not only graphically, \nbut with individual options as well.\n \nStep #4 - Shipping & Billing\n \nOnce we have an exact idea what you need us to do, \nwe will calculate the shipping costs and email you a bill.\nAs soon as the bill is paid we are off to production.'),
	(7,'Production Time','Typically artwork takes the longest and there is just no way of predicting how long it will take. Using our \"House Designs\" will definitely speed things up. Once you have made the decision to use our company, I recommend to get the art done ASAP, even if you don\'t plan on ordering for weeks or even months. All art is saved on our computers forever. To get started just click on the \"Order\" button. Typically artwork takes the longest and there is just no way of predicting how long it will take. Using our \"House Designs\" will definitely speed things up. Once you have made the decision to use our company, I recommend to get the art done ASAP, even if you don\'t plan on ordering for weeks or even months. All art is saved on our computers forever. To get started just click on the \"Order\" button.\n\nIn order to give you the maximum number of choices, we have a unique ordering process that might take some time to get used to - feel free to contact us if you have any questions.\nOnce art is completed and approved, things move very fast. Standard production time for single team order is 15 business days from payment or artwork approval (which ever comes last) to be shipped out the door\n\nWe do offer an EXPEDITE service as soon 7 days shipped or some like to call a procrastinator tax. If you do choose to use this service, please let us know when you need it by first to make sure we can get it to you by then. This service is also automatically upgraded to 2 day shipping. ....so you will have in your hands in 9 working days.\n\nStandard courier shipping usually takes about a week. We do not recommend the postal service, there is no tracking number and I personally suspect they are still using donkeys.\n\nOn few occasions when a customer needed an order ASAP, we were able to produce it and have it delivered into their hands within 24 hours, even though they were on the other side of the continent. Shipping costs on this are very high, but it is something we are able to do.'),
	(8,'Proofs','Before we go into production, we always send you low resolution \njpgs (snapshot). We need your approval that everything looks right \nand everything is spellid correctly. If you need something \nmore detailed, just let us know and we will email you \nmore detailed art.\n \nIt is impossible to change anything once the fabric is printed, \nso please take your time and double check. Once you give us your \napproval, there is a good chance your order is in production \nwithin hours. If you do find a mistake after an approval, \nplease contact us ASAP - it will avoid a lot of problems\n '),
	(9,'Raglan vs Set-in','<table style=\"margin-top:-200px\">\n	<tr>\n		<td align=\"center\">Raglan Sleeves</td>\n		<td align=\"center\">Set-In Sleeves</td>\n	</tr>\n	<tr>\n		<td colspan=\"2\" align=\"center\">\n			<img src=\"assets/img/web/faq_sleeves.png\">\n		</td>\n	</tr>\n</table>\nThere is a very little difference when you wear either garment. \nThe main reason why we make garments in both styles is to \naccommodate graphic design. Some designs just look better \non a certain style.\n \nThe raglan sleeves display uninterrupted graphics the full length \nof the sleeve and allow art on top of the shoulders without being \ninterrupted by a sewing line. The Set-in sleeves give you a \nlarger chest and back area to display graphics, names and logos.\n \nMajority of garments that we make are Set-in style. That is the \nmain reason why our site does not mention Raglan. Information \noverload lol. We recommend to customers the Raglan style \nwhen we feel the design calls for it.'),
	(10,'Short','There are two ways to construct shorts. Using 2 & 4 panels. \nThere is no difference when you wear either garment, but \nthere is a difference if you wish to have side pockets.\n \nIn order to have side pockets, we need to use the 4 panel \nconstruction. This creates a seam on both sides of your legs and \nmakes the garment stronger and able to support extra weight.\n \nWe use the 2 panel shorts because they are cheaper \n(less work) and they also allow uninterrupted graphics \non the sides (no sewing line).'),
	(11,'Submitting Art','Everything that we do is done in Corel Draw. This software is the \nmost suitable for our application. We do have other programs \nsuch as Illustrator and Photoshop, but they are not part of \nour production. We have them so we are able to convert files \nto Corel format. In some instances the conversion is not perfect \n(especially when using plug-ins) so if you are using software other \nthen Corel, please pay extra attention when checking our proofs.\n \nWhen sending us art, no matter what software or source, please \nsend us the original. Do not try to improve it in any way. If we \nhave a problem with anything that you send us, \nwe will let you know.\n \nOur final output that we send to production is a 200 dpi tiff in RGB.\n \nIf not sure, please email us what you have and let us take \na look at it. This is much easier then reading \n30 pages of requirements.\n \nIf you are sending us a Corel file, please export it (with selected \nonly option checked) as a CMX file. We find that this filter \ngets rid of a lot of junk that is invisible and fixes any \nimperfections in layers.\n '),
	(12,'Why i2i','WE ARE THE BEST.'),
	(13,'Your Design','Designing a garment requires more attention and some measuring. \nHere are some pointers to help you out. Make sure you use RGB \ncolors. Using CMYK or any other palette will create strange results.\n \nThe number one mistake people make, is that they make everything \ntoo big. It looks proportional on the artwork, but you have to take \ninto consideration the fact that this will become an object that \nwraps around your body and some things will be hidden. \nFor example a logo on your arm - most people make it 8\" wide, \nif you measure your arm you will see that only about 4\" are visible, \nthe rest you will not be able to see. Measure the area on your body \nand apply that size to your art.\n \nDue to sewing you loose 1/4\" all around, at the bottom you \nloose 3/4\". So if there is something important, keep it \nat least 1\" from any edge.\n \nGarments come in different sizes, so we do all our designs in size\n1x. Going smaller or bigger the length and width do not change \nproportionally. The best way to deal with this issue is to make the \nart a little bigger on both sides and at the bottom as well (2\"). \nDo not extend the top - this makes sure everything is positioned \nthe same, this applies to sleeves as well. Detailed instructions are \nwithin all our template files. Feel free to contact us \nif you have any questions.');
