INSERT INTO `master_webpages` (`webpage_id`, `title`, `text`)
VALUES
	(10,'Privacy policy','This Privacy Policy governs the manner in which i2icustom.com collects, uses, maintains and discloses information collected from users (each, a \"User\") of the http://www.i2icustom.com/ website (\"Site\"). This privacy policy applies to the Site and all products and services offered by i2icustom.com.\r\n<br/><br/>\r\nPersonal identification information\r\n<br/><br/>\r\nWe may collect personal identification information from Users in a variety of ways, including, but not limited to, when Users visit our site, register on the site, place an order, fill out a form, and in connection with other activities, services, features or resources we make available on our Site. Users may be asked for, as appropriate, name, email address, mailing address, phone number. Users may, however, visit our Site anonymously. We will collect personal identification information from Users only if they voluntarily submit such information to us. Users can always refuse to supply personally identification information, except that it may prevent them from engaging in certain Site related activities.\r\n<br/><br/>\r\nNon-personal identification information\r\n<br/><br/>\r\nWe may collect non-personal identification information about Users whenever they interact with our Site. Non-personal identification information may include the browser name, the type of computer and technical information about Users means of connection to our Site, such as the operating system and the Internet service providers utilized and other similar information.\r\n<br/><br/>\r\nWeb browser cookies\r\n<br/><br/>\r\nOur Site may use \"cookies\" to enhance User experience. User\'s web browser places cookies on their hard drive for record-keeping purposes and sometimes to track information about them. User may choose to set their web browser to refuse cookies, or to alert you when cookies are being sent. If they do so, note that some parts of the Site may not function properly.\r\n<br/><br/>\r\nHow we use collected information\r\n<br/><br/>\r\ni2icustom.com may collect and use Users personal information for the following purposes:\r\n<br/><br/>\r\n- To improve customer service\r\n    Information you provide helps us respond to your customer service requests and support needs more efficiently.<br/>\r\n- To personalize user experience<br/>\r\n    We may use information in the aggregate to understand how our Users as a group use the services and resources provided on our Site.<br/>\r\n- To improve our Site<br/>\r\n    We may use feedback you provide to improve our products and services.<br/>\r\n- To process payments<br/>\r\n    We may use the information Users provide about themselves when placing an order only to provide service to that order. We do not share this information with outside parties except to the extent necessary to provide the service.<br/>\r\n- To run a promotion, contest, survey or other Site feature<br/>\r\n    To send Users information they agreed to receive about topics we think will be of interest to them.<br/>\r\n- To send periodic emails<br/>\r\nWe may use the email address to send User information and updates pertaining to their order. It may also be used to respond to their inquiries, questions, and/or other requests. If User decides to opt-in to our mailing list, they will receive emails that may include company news, updates, related product or service information, etc.<br/><br/>\r\n\r\nHow we protect your information\r\n<br/><br/>\r\nWe adopt appropriate data collection, storage and processing practices and security measures to protect against unauthorized access, alteration, disclosure or destruction of your personal information, username, password, transaction information and data stored on our Site.\r\n<br/><br/>\r\nOur Site is in compliance with PCI vulnerability standards in order to create as secure of an environment as possible for Users.\r\n<br/><br/>\r\nSharing your personal information\r\n<br/><br/>\r\nWe do not sell, trade, or rent Users personal identification information to others. We may share generic aggregated demographic information not linked to any personal identification information regarding visitors and users with our business partners, trusted affiliates and advertisers for the purposes outlined above.\r\n<br/><br/>\r\nThird party websites\r\n<br/><br/>\r\nUsers may find advertising or other content on our Site that link to the sites and services of our partners, suppliers, advertisers, sponsors, licensors and other third parties. We do not control the content or links that appear on these sites and are not responsible for the practices employed by websites linked to or from our Site. In addition, these sites or services, including their content and links, may be constantly changing. These sites and services may have their own privacy policies and customer service policies. Browsing and interaction on any other website, including websites which have a link to our Site, is subject to that website\'s own terms and policies.\r\n<br/><br/>\r\nChanges to this privacy policy\r\n<br/><br/>\r\ni2icustom.com has the discretion to update this privacy policy at any time. When we do, we will post a notification on the main page of our Site, revise the updated date at the bottom of this page. We encourage Users to frequently check this page for any changes to stay informed about how we are helping to protect the personal information we collect. You acknowledge and agree that it is your responsibility to review this privacy policy periodically and become aware of modifications.\r\n<br/><br/>\r\nYour acceptance of these terms\r\n<br/><br/>\r\nBy using this Site, you signify your acceptance of this policy. If you do not agree to this policy, please do not use our Site. Your continued use of the Site following the posting of changes to this policy will be deemed your acceptance of those changes.\r\n<br/><br/>\r\nContacting us\r\n<br/><br/>\r\nIf you have any questions about this Privacy Policy, the practices of this site, or your dealings with this site, please contact us at:<br/><br/>\r\ni2icustom.com<br/>\r\nhttp://www.i2icustom.com/<br/>\r\n3097A Universal Drive<br/>\r\nMississauga, Ontario<br/>\r\nL4X2E2<br/>\r\nCanada<br/>\r\n905.266.0161<br/>\r\nwebsales@i2icustom.com<br/>');
