	(11,'BRITTANY','Harris','harrisbrittany25@yahoo.com','6623648765 or 6623284656','I was wondering was there anyway you guys could customize jerseys for me with polka dots and other prints! How can I attach pictures to explain of what I\'m inquiring of?','2013-06-29 07:17:59',0),
