	(14,'Keith','Robillard','keithrobillard@rogers.com','7055299472','Looking for curling outfits for my two teams I need 7 coats would like sublimation on them the sponsor is Georgian Bay Sanitation we would like something to reflect the area and the company it\'s  slogan is taking your crap for over 40 years a Georgian bay pine on a rock with an old out house in the background names on back of player name of the company can be small on the front or sleeve','2013-11-11 03:43:34',0),
