INSERT INTO `size_text` (`id`, `title`, `content`)
VALUES
	(1,'I2ICUSTOM SIZING GUIDE','We make many different garments that are suitable for many different activities. Some are loose and some are body fitting, which means that they are all different size.\nWhat Im trying to say is that our large jersey and large t-shirt will fit a person that wears large; the garment itself will be a different size.\nConsidering we do not have a location to try the garment on we have to be a little creative when finding the perfect fit.\nPlease note, we are a custom** sublimation company and we do not carry samples, many customers have found that it is best to first order a few sizes with their design before ordering a full run to be absolutely sure.\n**Custom also means we can make length adjustments to the body and/or arms as well as inseam.\nImage on the left to assist you in determining your perfect fit.\nFor example, you will find all the measurements on the following pages color coded based on the image on the left.');
